import logo from './logo.svg';
import './App.css';
import NavBar from './components/NavBar/NavBar';
import Cards from './components/Card/Cards';
import Footer from './components/Footer/Footer';

function App() {
  return (
    <div>
      <NavBar />
      <Cards />
      <Footer />
    </div>
  );
}

export default App;
